var IndexController = {
    init : function() {
    	N("a#btnCommunicator").click(function(e) {
		    e.preventDefault();
		    N(N.context.attr("architecture")["page"]["context"]).comm("prototype/communicator.html").submit();
	    });
    	
    	N("a#btnController").click(function(e) {
		    e.preventDefault();
		    N(N.context.attr("architecture")["page"]["context"]).comm("prototype/controller.html").submit();
	    });

	    N("a#btnFormater").click(function(e) {
		    e.preventDefault();
		    N(N.context.attr("architecture")["page"]["context"]).comm("prototype/formater.html").submit();
	    });

	    N("a#btnValidator").click(function(e) {
            e.preventDefault();
            N(N.context.attr("architecture")["page"]["context"]).comm("prototype/validator.html").submit();
        });

	    N("a#btnAlert").click(function(e) {
		   e.preventDefault();
		   N(N.context.attr("architecture")["page"]["context"]).comm("prototype/alert.html").submit();
	    });

	    N("a#btnButton").click(function(e) {
		   e.preventDefault();
		   N(N.context.attr("architecture")["page"]["context"]).comm("prototype/button.html").submit();
	    });

	    N("a#btnDate").click(function(e) {

		   N(N.context.attr("architecture")["page"]["context"]).comm("prototype/datepicker.html").submit();

	    N("a#btnPopup").click(function(e) {

		   N(N.context.attr("architecture")["page"]["context"]).comm("prototype/popup.html").submit();
	    });

		   e.preventDefault();
		   N(N.context.attr("architecture")["page"]["context"]).comm("prototype/tab.html").submit();
	    });

		   e.preventDefault();
		   N(N.context.attr("architecture")["page"]["context"]).comm("prototype/select.html").submit();
	    });

	    N("a#btnForm").click(function(e) {
		   e.preventDefault();
		   N(N.context.attr("architecture")["page"]["context"]).comm("prototype/form.html").submit();
	    });

		   N(N.context.attr("architecture")["page"]["context"]).comm("prototype/grid.html").submit();
	    });

		   e.preventDefault();
		   N(N.context.attr("architecture")["page"]["context"]).comm("prototype/grid_form_popup.html").submit();
	    });
    },
    getSourceCode : function(url, target) {
    	var isEmbed = target.parents(".popup__, .tab__, .result").length > 0 ? true : false;
    	if(!isEmbed) {
    		N.comm({
        		url : url,
        		contentType : "application/x-www-form-urlencoded",
        		dataType : "html"
        	}).submit(function(html) {
        		target.text(html.replace(/\t/g, "    "));
        	});
    	}
    }
}
$(document).ready(function() {
    IndexController.init();
});
